import { Book } from "./Book";

const img = "https://m.media-amazon.com/images/I/51xwGSNX-EL._SY445_SX342_.jpg";
const author = "jordan moore";
const title = "ikigai";

const firstBook = {
  img: "https://m.media-amazon.com/images/I/41SUSwxQ14L._SY445_SX342_.jpg",
  author: "jordan ..................",
  title: "ikigai",
  id: 1,
};
const secondbook = {
  img: "https://m.media-amazon.com/images/I/41SUSwxQ14L._SY445_SX342_.jpg",
  author: "jor-----dan ..................",
  title: "ikigai",
  id: 2,
};

const books = [firstBook, secondbook];
// const names = ["jhon", "peter"];
// const newNames = names.map((a) => {
//   return <h1>{names}</h1>;
// });

export const Booklist = () => {
  const { img, author, title } = firstBook;
  return (
    <section className="booklist">
      {/* <Book author={author} img={img} title={title}></Book>
      <Book author={author} img={img} title={title} />
      <Book author={author} img={img} title={title} />
      <Book author={author} img={img} title={title} /> */}
      {books.map((book) => {
        const { img, title, author } = book;
        return <Book img={img} title={title} author={author} />;
      })}
    </section>
  );
};
